import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

import './App.css';

import Menu from './pages/Menu';

function App() {
  return (
    <Router>
      <div class="jumbotron">
        <Routes>
          <Route path='/' Component={Menu} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
